import React from 'react';
import styled from 'styled-components';
import Header from './Header';
import Footer from './Footer';

const AboutUs = styled.div`
  background-color: #fff;
  display: flex;
  flex-direction: column;
  align-items: center;
  min-height: 100vh;
`;

const MainContent = styled.div`
  background-color: #fff;
  display: flex;
  width: 100%;
  flex-direction: column;
  align-items: center;
  padding: 21px 0 0px;
`;

const PageTitle = styled.h1`
  color: #000;
  font-size: 80px;
  font-family: Inter, -apple-system, Roboto, Helvetica, sans-serif;
  font-weight: 700;
  line-height: 1;
  margin-top: 150px;
`;

const ContentSection = styled.section`
  display: flex;
  margin-top: 4px;
  width: 100%;
  max-width: 70%;
  gap: 100px;
  font-family: Inter, -apple-system, Roboto, Helvetica, sans-serif;
  color: #000;

  @media (max-width: 991px) {
    flex-direction: column;
    max-width: 90%;
  }

`;

const Sidebar = styled.aside``;

const SidebarNav = styled.nav`
  font-size: 15px;
  font-weight: 600;
  width: max-content;
  line-height: 23px;
  padding-top: 21px;
`;

const Description = styled.p`
  font-size: 14px;
  font-weight: 300;
  text-align: justify;
  line-height: 22px;
  margin-bottom: 20px;
`;

const TeamSection = styled.section`
  background-color: #fff;
  width: 100%;
  max-width: 80%;
  padding: 75px 0px 135px;
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const TeamBanner = styled.img`
  width: 100%;
  max-width: 93%;
  height: auto;
`;

const QuoteContainer = styled.div`
  margin-top: 96px;
  width: 100%;
  max-width: 987px;
`;

const QuoteContent = styled.div`
  display: flex;
  align-self: center;
  align-items: center;
  gap: 40px;
  max-width: 100%;
`;

const QuoteImage = styled.img`
  width: 55%;
  height: auto;
  object-fit: contain;
`;

const QuoteText = styled.div`
  width: 45%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  font-style: italic;

  blockquote {
    font-size: 30px;
    font-family: Inria Serif, -apple-system, Roboto, Helvetica, sans-serif;
    font-weight: 500;
    font-style: italic;
    line-height: 47px;
    margin: 0;
  }
`;

const QuoteAuthor = styled.p`
  font-size: 14px;
  font-family: Inter, -apple-system, Roboto, Helvetica, sans-serif;
  font-weight: 300;
  line-height: 2;
  margin: 0;
`;

const SectionTitle = styled.h2`
  align-self: center;
  color: #000;
  font-size: 50px;
  font-family: Inter, -apple-system, Roboto, Helvetica, sans-serif;
  font-weight: 700;
  line-height: 2;
  margin-top: 77px;
`;

const TeamGallery = styled.div`
  display: flex;
  gap: 20px;
  margin-top: 26px;
`;

const TeamMember = styled.div`
  width: 33.33%;
`;

const MemberImage = styled.img`
  width: 100%;
  height: auto;
  object-fit: contain;
`;

const TeamDescription = styled.p`
  color: #000;
  font-size: 14px;
  text-align: justify;
  font-family: Inter, -apple-system, Roboto, Helvetica, sans-serif;
  font-weight: 300;
  line-height: 22px;
  margin-top: 42px;
`;

const Article = styled.article`
  flex: 1;
`;

